import React from "react";

const Credits = (props) => {
  return (
    <div className="Credits">
      <img
        src="https://cdn.worldvectorlogo.com/logos/github-icon.svg"
        width="20px"
        height="20px"
      />
      <h4>Mariano Zorrilla</h4>
    </div>
  );
};

export default Credits;
